import { Link } from "react-router-dom";
import "./card.css";

const Carditem = ({category,src,text,path}) => {
  return (
    <li className="cards-item">
      <Link className="cards-item-link" to={path}>
        <figure className="cards-item-pic-wrap" data-category={category}>
          <img
            src={source}
            alt="Travel Image"
            className="cards-item-img"
          />
        </figure>
        <div className="cards-item-info">
          <h5 className="cards-item-text">
            {text}
          </h5>
        </div>
      </Link>
    </li>
  );
};
export default Carditem;
